import React from 'react';

function ProgramsPage() {
  return (
    <div className="page-container">
      <h2>프로그램 안내</h2>
      <p>노바문화센터의 다양한 프로그램을 만나보세요!</p>
    </div>
  );
}

export default ProgramsPage;
